import { SystemReq } from "../../../model/game.model";
import { ReqsItem } from "../atoms/ReqsItem";

interface Props {
  reqs: SystemReq;
}

export const SystemReqs: React.FC<Props> = (reqs) => {
  return (
    <>
      {Object.entries(reqs).map(([key, value]) => (
        <ReqsItem key={key} first={key} second={value} />
      ))}
    </>
  );
};
